async function generateNewSingleData(id) {
  const newData = {};
  await fetch('https://dog.ceo/api/breeds/image/random')
    .then(res => res.json())
    .then(data => {
      newData.id = id;
      newData.name = `Doggie ${newData.id}`;
      newData.imageUrl = data.message;
      newData.price = Math.floor(Math.random() * 10) + 1;
    });
  console.log(newData);

  return newData;
}

function generateDataCollection(dataArray) {
  for (let i = 0; i < 10; i++) {
    const newData = generateNewSingleData(i);
    console.log(newData);
    dataArray.push(newData);
    console.log(dataArray);
  }
  return dataArray;
}

export default generateDataCollection;
